When I took my current job, I requested this week off to help the kids transition into the new school year. The original plan was to only keep a couple of days off, but with Covid, remote learning, and a new nanny starting, I decided to keep the entire week off. 
•
•
•
Now listen to this: I decided, kinda last minute, that I was going to invest some of that time off in me. So, I kept my alarm at 5 am, and got out of bed every day to work out... to work on me! So, yeah, I’m gonna brag about...!
Not gonna sugarcoat it: it was hard! But, it felt good to do something for myself. I felt accomplished by 6 am. I felt I could handled anything thrown my way after that... including homeschooling! 😂
•
•
•
Not sure what I’m gonna do next week, when I get back to work. I already wake up at 5 am just to get out the door on time. But, I’ll figure something out!
•
•
•
In the mean time, I’ll pat myself on the back, and be my own cheerleader. Go, me!!! 💪🏻💪🏻
